import React from 'react'
import Navbar from './components/Navbar'

function Profile() {
  return (
    <div>
        <Navbar/>
        <div className='profile-body'>
            {/* left box */}
            <div>
                <img src='./images/profile.jpg' />
            </div>
        </div>

    </div>
  )
}

export default Profile
